import React from 'react';
import "./Blogs.css"
  
const Blogs = () => {
  return (
    <div>
      <h1 className="bl-name">About Celo</h1>
      <p className="bl-par">First and foremost, we would like to express our gratitude to the Bitcoin startup Foundation
for providing this extensive knowledge and competitive opportunity in the
upcoming field of ReFi technology. We are presenting our project to the world's
best ReFi foundation because it is entirely about ReFi DAOs.<br></br></p>
<h1>THANKING THE RBTC
FOUNDATION AGAIN FOR GIVING REFI ENTHUSIASTIC SUCH A ONCE IN A LIFETIME
OPPORTUNITY</h1>
<img src="./logo-dark.png" />
<h1>“We each have a special something ,we can get only at a special time of our life.
Like a small flame , A careful fortunate , few cherish that flame, nurture it, hold it
as a torch to light their way. But once that flame goes out, it’s gone forever.”</h1>

    </div>
  );
};
  
export default Blogs;
